import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import RegisterPage from "./pages/RegisterPage";
import Dashboard from "./pages/Dashboard";
import Contas from "./pages/Contas";
import Monitoramento from "./pages/Monitoramento";
import Perfil from "./pages/Perfil";
import Configuracoes from "./pages/Configuracoes";
import HomeLayout from "./pages/HomeLayout";
import OrdensAuto from "./pages/OrdensAuto";
import GestaoFinanceira from "./pages/GestaoFinanceira"; // Novo import

const isAuthenticated = () => !!localStorage.getItem("token");

const PrivateRoute = ({ children }) => {
  return isAuthenticated() ? children : <Navigate to="/" />;
};

function App() {
  return (
<Route path="/" element={<PrivateRoute><HomeLayout /></PrivateRoute>}>
    <Route path="dashboard" element={<Dashboard />} />
    <Route path="contas" element={<Contas />} />
    <Route path="monitoramento" element={<Monitoramento />} />
    <Route path="gestao" element={<GestaoFinanceira />} /> {/* Rota atualizada */}
    <Route path="ordensauto" element={<OrdensAuto />} />
    <Route path="configuracoes" element={<Configuracoes />} />
</Route>
  );
}

export default App;
